import React, { useState } from 'react';
import { Course, getPrerequisites, getCorequisites, courses } from '../data/courses.ts';

interface FlowchartProps {
  selectedCourse: Course | null;
  onCourseClick: (course: Course) => void;
}

const Flowchart: React.FC<FlowchartProps> = ({ selectedCourse, onCourseClick }) => {
  const [hoveredCourse, setHoveredCourse] = useState<Course | null>(null);

  // Get courses organized by year and semester
  const getCoursesByYearAndSemester = () => {
    const organized: { [key: string]: Course[] } = {};

    courses.forEach(course => {
      const semesterKey = `Year ${course.year} ${course.semester}`;
      if (!organized[semesterKey]) {
        organized[semesterKey] = [];
      }
      organized[semesterKey].push(course);
    });

    // Sort semesters in chronological order
    const sortedKeys = Object.keys(organized).sort((a, b) => {
      const yearA = parseInt(a.split(' ')[1]);
      const yearB = parseInt(b.split(' ')[1]);
      if (yearA !== yearB) return yearA - yearB;
      return a.includes('Fall') ? -1 : 1;
    });

    return sortedKeys.map(key => ({ semester: key, courses: organized[key] }));
  };

  const semesterData = getCoursesByYearAndSemester();

  const getCourseHighlightColor = (course: Course) => {
    if (!hoveredCourse) return 'bg-white';

    // Check if this course is a prerequisite of the hovered course
    const prerequisites = getPrerequisites(hoveredCourse.id);
    const isPrerequisite = prerequisites.some(prereq => prereq.id === course.id);

    // Check if this course is a corequisite of the hovered course
    const corequisites = getCorequisites(hoveredCourse.id);
    const isCorequisite = corequisites.some(coreq => coreq.id === course.id);

    // Check if this course has the hovered course as a prerequisite
    const hasHoveredAsPrerequisite = getPrerequisites(course.id).some(prereq => prereq.id === hoveredCourse.id);

    if (isPrerequisite) return 'bg-yellow-100 border-orange-500';
    if (isCorequisite) return 'bg-blue-100 border-blue-500';
    if (hasHoveredAsPrerequisite) return 'bg-pink-100 border-pink-500';
    if (course.id === hoveredCourse.id) return 'bg-yellow-100 border-orange-500';

    return 'bg-white border-gray-300';
  };

  return (
    <div className="w-full h-full overflow-auto bg-gradient-to-br from-blue-50 via-indigo-50 to-purple-50 p-8">
      <div className="flex gap-8 min-w-max">
        {semesterData.map((semester) => (
          <div key={semester.semester} className="flex-shrink-0">
            {/* Semester Header */}
            <div className="text-center mb-6">
              <div className="bg-white rounded-full px-6 py-2 border-2 border-black shadow-lg inline-block">
                <h3 className="text-lg font-bold text-gray-900">{semester.semester}</h3>
              </div>
            </div>

            {/* Course Cards */}
            <div className="space-y-4">
              {semester.courses.map((course) => {
                const highlightClass = getCourseHighlightColor(course);

                return (
                  <div
                    key={course.id}
                    className={`w-64 p-4 rounded-lg border-2 shadow-lg cursor-pointer transition-all duration-200 hover:shadow-xl ${highlightClass}`}
                    onMouseEnter={() => setHoveredCourse(course)}
                    onMouseLeave={() => setHoveredCourse(null)}
                    onClick={() => onCourseClick(course)}
                  >
                    <div className="font-bold text-gray-900 mb-2">{course.code}</div>
                    <div className="text-sm text-gray-700 mb-2 leading-tight">{course.name}</div>
                    <div className="text-xs text-gray-500">{course.units} units</div>
                  </div>
                );
              })}
            </div>
          </div>
        ))}
      </div>

      {/* Legend */}
      {hoveredCourse && (
        <div className="fixed top-4 left-4 bg-white rounded-lg border-2 border-black shadow-lg p-4 z-10">
          <div className="text-sm font-bold text-gray-900 mb-3">Course Relationships</div>
          <div className="space-y-2">
            <div className="flex items-center space-x-2">
              <div className="w-4 h-4 bg-yellow-100 border-2 border-orange-500 rounded"></div>
              <span className="text-xs text-gray-700">Prerequisites</span>
            </div>
            <div className="flex items-center space-x-2">
              <div className="w-4 h-4 bg-blue-100 border-2 border-blue-500 rounded"></div>
              <span className="text-xs text-gray-700">Corequisites</span>
            </div>
            <div className="flex items-center space-x-2">
              <div className="w-4 h-4 bg-pink-100 border-2 border-pink-500 rounded"></div>
              <span className="text-xs text-gray-700">Following Courses</span>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default Flowchart;
